import Vue from 'vue'
import App from './App.vue'
import router from './router'
import MintUI from "mint-ui"
//单独引入mint-ui样式文件
import "mint-ui/lib/style.css"

//使用组件
Vue.use(MintUI)
//引入图标字体




new Vue({
  router,
  render: h => h(App)
}).$mount('#app')
